import React from 'react';
const HomePage = () => (
    <React.Fragment>
    <h1>Welcome</h1>

    <p>Learn about <a href="https://docs.microsoft.com/aspnet/core">building Web apps with ASP.NET Core</a>.</p>
    </React.Fragment>
);

export default HomePage;
